    true,nt"url": null,nt"notes": "<p>ANA promotes self-sufficiency for Native
    Americans by providing discretionary grant funding for community based projects,
    and training and technical assistance to eligible tribes and native organizations.
     Each year, ANA provides grants to Native American and Pacific Islander communities
    for economic and social development, language and cultural preservation and environmental
    enhancement projects.  ANA funded 61 new grant applications and 112 continuation
    grant awards for a total 173 awards to Tribal, Native American, and Pacific Islander
    communities during FY 2013 funding circle.</p>n",nt"license_title": "Other
